import React from 'react'

import { Card } from 'semantic-ui-react'
import '../stylesheets/userConsole.css'

const ChoosePoke = (props) => {
	return (
		<Card id='successcard'>
			<img id='caughtpoke' src={props.mainPoke.front} alt={props.mainPoke.name} />
			<h4 id='fail-catch-text'>
				I CHOOSE YOU, {props.mainPoke.name.toUpperCase()}
			</h4>
		</Card>
	)
}

export default ChoosePoke
